import React from 'react';
import { ChakraProvider } from "@chakra-ui/react";
import Speed from './components/Speed'
import Operation from './components/Operation';

function App() {
  return 
  <ChakraProvider>

    <Speed/>
    <Operation/>
 
  </ChakraProvider>
  ;
}

export default App;
